- input: "TEXT\x1CC00167130\x1CX0\x1C\x1CF3XA\x1CThe Committee is in receipt of the
    Commissions Request for Further Information dated 3/29/2013.  The original e-mail
    for this request was not received by the Committee.  The Committee has since updated
    its Statement of Organization with a second e-mail to help prevent this from occurring
    in the future. -  1.) Committee inadvertently disclosed a transfer from the DNC
    Service Corporation - Democratic National Committee.  This amended report correctly
    discloses this transfer from the Democratic Senatorial Campaign Committee. - 2.)
    \ The Transfers in from Badey for Congress, Klobuchar for Minnesota, and Obama
    for America have been clarified on this amended report.  -  3.) Schedule A Line
    12 refunds from Alberto Rojas Cardona, Neil Jaffe, Ricardo E Oquendo, and V. Carlos
    Rojas Cardona were for contributions originally reported on 12/31/11. -  4.) The
    Memo entries on Schedule A now identify the correct Joint Fundraising Committee
    that each entry relates to for the transfers on Schedule A Supporting Line 12
    \ - Please note that some transfers may have occurred in prior reporting periods
    or will  happen at a future date.  -  5.) Expenditures disclosed on Schedule F
    for Line 25 on behalf of Kathryn Boockvar, Manan Trivedi, and Bob Casey that were
    disclosed after the General Election date were in fact for expenditures that occurred
    prior to the General Election as noted on this amended report. -  6.)  Please
    note that KVF-NF is a Non-Federal Account of the Committee.  -  7.)  The Schedule
    H4 disclosure in question to Bank of America for $389.11 is one of multiple payments
    on 10/22/12, the committee inadvertently had one of the payments for $2,543.27
    disclosed on Schedule B while all the memo items were appearing on Schedule H4.
    \ This amendment has the payment appropriately disclosed on Schedule H4 now as
    well.   -  8.) Transfers in from the Democratic Congressional Camp. Comm., Democratic
    Senatorial Campaign Committee, and DNC Service Corporation - Democratic National
    Committee are not designated for any FEA or Exempt Activities.  Transfers now
    are all being disclosed on Schedule A Supporting Line 12  -  In addition, due
    to duplicates found in the database and the merging of them, the Lines 11(a)(i)
    and 11(a)(ii) have been adjusted as well.  Also, the committee found several instances
    where transfers were reported as contribution on Schedule A for Line 11c vs. Schedule
    A for Line 12.  These changes have been made and do affect the Detailed Summary
    Pages. -  Previously Filed Notes: Levin L-B Schedules from another date range
    were inadvertently included on a previously filed report.  -  This report is being
    amended to correct itemization for memo entries to parent transactions that were
    not reporting correctly on the previously filed report as well as the clarification
    of Payments identified as Travel Stipend on this report that were not cash payments;
    furthermore, these payments were monthly stipend payments in accordance with policies
    of the committee and not a reimbursement for any specific travel expense. In addition,
    a duplicate in the database was discovered and merged which in turn made the donor
    move from un-itemized to itemized which is reflected on the detailed summary pages.
    - Employees that were disclosed on Schedule H4 supporting Line 21(a) and Schedule
    B supporting Line 21(b) as payroll spent less than 25% of their time during the
    period working on any Federal Election Activity or activities in connection with
    a Federal Election therefore salary payments were allocable.  This also includes
    fringe benefits for those specific employees. - Any fundraising activity on this
    report was for the sole benefit of the Committee and was not attributable to any
    candidate for federal office. - Memo Schedule A's that itemize the committees
    share of the gross contributions received through the joint fundraising activities
    from the Keystone Victory Fund are provided on this report. The transfer of the
